import React from "react";

function Card(props) {



    return (
        <div className="card ">
            <img src={props.cardData.image} alt="User Image" />
            <h1>{props.cardData.name}</h1>
            <h2>{props.cardData.function}</h2>

            <h3 style={{display: props.cardData.phone == ""? "none": "block"}}>
                {`Phone: ${props.cardData.phone}`}
            </h3>

            <h3 style={{display: props.cardData.email == "" ? "none" : "block"}}>
                {`Email: ${props.cardData.email}`}
            </h3>

            <h3 style={{display: props.cardData.website == "" ? "none": "block" }}>
                {}`Website: ${props.cardData.website}`}
            </h3>

        </div>
    );

}

export default Card;
